import React, { useState } from "react";
import "./HomePage.css";

function HomePage({ onLogout }) {
  const [activeTab, setActiveTab] = useState("Servers");

  const renderContent = () => {
    switch (activeTab) {
      case "Servers":
        return <div className="tab-panel">Server management tools and list go here.</div>;
      case "Zones":
        return <div className="tab-panel">Zone management section.</div>;
      case "Server Statistics":
        return <div className="tab-panel">Performance graphs and metrics appear here.</div>;
      default:
        return null;
    }
  };

  return (
    <div className="homepage-container">
      <header className="homepage-header">
        <div className="homepage-left">
          <span role="img" aria-label="home" className="home-icon">üè†</span>
          <a href="/" className="home-link">Home</a>
        </div>
        <button className="button logout-button" onClick={onLogout}>Logout</button>
      </header>

      <nav className="homepage-tabs">
        {["Servers", "Zones", "Server Statistics"].map((tab) => (
          <button
            key={tab}
            className={`tab-button ${activeTab === tab ? "active" : ""}`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </button>
        ))}
      </nav>

      <main className="homepage-content">
        {renderContent()}
      </main>
    </div>
  );
}

export default HomePage;
